import React from 'react';

function About() {
  return (
    <div>
      <h1>About This App</h1>
      <p>
        The SpaceX Launch Finder allows users to search and view past SpaceX launches using live data
        from the public SpaceX API.
      </p>
      <h3>Information Shown:</h3>
      <ul>
        <li><strong>Mission Name:</strong> The name of the SpaceX launch mission.</li>
        <li><strong>Date:</strong> The UTC date the mission was launched.</li>
        <li><strong>Rocket:</strong> The name of the rocket used for the mission.</li>
      </ul>
      <p>
        Use the search box on the homepage to filter launches by mission name (e.g., "Falcon").
      </p>
    </div>
  );
}


export default About;
